import React from "react";
import Wheel from './Wheel'

export class Deals extends React.Component {
  constructor() {
    super();
    this.places = ['Pizzas', 'Sandwiches', 'Salads', 'Soup', 'Japanese food', 'Pastas'];
  }

  render() {
    return (
    <div class="grid-container">
    <div class="wheelitem">
    <div className="App">
        <h1>What should you eat today?</h1>
        <Wheel items={this.places} />
      </div>
    </div>
    <div class="dailydeals">
      <div class="dealcard rounded">
        <img
          class="ddealimgfirst"
          src="./images/hamburger-beside-fries-2271107.png"
          alt="food-deal"
        />

        <button class=" ddealbtn button-error pure-button">Daily Deal</button>
      </div>
    </div>
    <div class="weeklydeals">
      <div class="dealcard rounded">
        <img
          class="wdealimgfirst"
          src="./images/hamburger-beside-fries-2271107.png"
          alt="food-deal"
        />
        <svg
          class="bi bi-plus-circle plus"
          width="4em"
          height="4em"
          viewBox="0 0 16 16"
          fill="#955F61"
          xmlns="http://www.w3.org/2000/svg"
        >
          <path
            fill-rule="evenodd"
            d="M8 3.5a.5.5 0 01.5.5v4a.5.5 0 01-.5.5H4a.5.5 0 010-1h3.5V4a.5.5 0 01.5-.5z"
            clip-rule="evenodd"
          />
          <path
            fill-rule="evenodd"
            d="M7.5 8a.5.5 0 01.5-.5h4a.5.5 0 010 1H8.5V12a.5.5 0 01-1 0V8z"
            clip-rule="evenodd"
          />
          <path
            fill-rule="evenodd"
            d="M8 15A7 7 0 108 1a7 7 0 000 14zm0 1A8 8 0 108 0a8 8 0 000 16z"
            clip-rule="evenodd"
          />
        </svg>
        <img
          class="wdealimgsecond"
          src="./images/club-sandwich-served-on-chopping-board-1600711.png"
          alt="food-deal"
        />
        <button class=" wdealbtn button-error pure-button ">
          Weekly Deal
        </button>
      </div>
    </div>
  </div>
    );
  }
}

const rootElement = document.getElementById('root');
